import styled from '@emotion/styled'

import { Headline, PageWrapper } from 'Layouts'
import { pageTransitionEasing, slideUp } from 'styles'

export const HomeWrapper = styled(PageWrapper)`
  max-width: initial;
  animation: ${slideUp} ${pageTransitionEasing} 0.5s;
  background-image: url('../../assets/bg_image.jpg');
  background-image: url('https://www.google.com/imgres?imgurl=https%3A%2F%2Fhips.hearstapps.com%2Fhmg-prod.s3.amazonaws.com%2Fimages%2Fdog-puppy-on-garden-royalty-free-image-1586966191.jpg%3Fcrop%3D1.00xw%3A0.669xh%3B0%2C0.190xh%26resize%3D640%3A*&imgrefurl=https%3A%2F%2Fwww.goodhousekeeping.com%2Flife%2Fpets%2Fg4531%2Fcutest-dog-breeds%2F&tbnid=sgZuc8rXuAGvoM&vet=12ahUKEwjijMvDvPL7AhWA8rsIHUYbDsoQMygAegUIARDdAQ..i&docid=2r6Arj4-hBjhNM&w=640&h=321&q=dog&ved=2ahUKEwjijMvDvPL7AhWA8rsIHUYbDsoQMygAegUIARDdAQ');
`

export const HomeHeadline = styled(Headline)`
  text-align: center;
`
